openLoginClick = 0;

function openLogin() {
    
  
    
    
    if (openLoginClick == 0) {
    
        $("#header_login_sub").fadeIn(300);
        openLoginClick = 1;
        
}

    else {
        
        $("#header_login_sub").fadeOut(300);
        openLoginClick = 0;
        
        
    }
    
}
  
openRegionClick = 0;

function openRegion() {
    
  
    
    
    if (openRegionClick == 0) {
    
        $("#header_region_sub").fadeIn(200);
        openRegionClick = 1;
        
}

    else {
        
        $("#header_region_sub").fadeOut(200);
        openRegionClick = 0;
        
        
    }
    
}
  
     
   
openMenuClick = 0;

function openMenu() {
    if (openMenuClick == 0) {
        $("#mobileMenu").fadeIn(500);
        $("html").css('overflow' , 'hidden'); 
        openMenuClick = 1;
    }

    else {
        
        $("#mobileMenu").fadeOut(500);
        $("html").css('overflow' , 'auto');
        openMenuClick = 0;
        
        
    }
    
}
  

$("#tabs").on("click", ".mobile-menu__body-menu__item", function(){
    $(".active__sub").removeClass('active__sub'); 
	$(this).toggleClass("active__sub");
});


